import React, { Component } from 'react';
import {Modal, Header } from 'semantic-ui-react';
import PropTypes from 'prop-types';

class SkillModal extends Component {
    constructor(props) {
        super(props);
    }


    componentDidMount() {
    }

    render() {
        const skill = this.props;
        return (
            <Modal open={skill.showDescription} style={{minwidth: '60vw', minHeight: '50vh', padding: '1em'}}>
                <Header>
                    {skill.name}
                </Header>
                <Header>
                    {skill.level}
                </Header>
                <p>
                    {skill.description}
                </p>
            </Modal>
        );
    }
};

export default SkillModal;
